import { Navigate } from 'react-router-dom';
import Modal from '';
import { getAuthToken } from '../util/auth';

const PrivateRoute = ({ element }) => {
    const token = getAuthToken();

    return token ? element : <Navigate to="/auth" />;
};

export default PrivateRoute;
